    num_downloads: "500,000,000+",
    app_description:
      "Organize your thoughts, discoveries, and ideas and simplify planning important moments in your life with your digital notepad. Take notes on your phone and sync them across all your devices with Microsoft OneNote.\n\nWith OneNote, you can plan a big event, seize a moment of inspiration to create something new, and track your list of errands that are too important to forget. Take notes, write memos and make a digital sketchbook right on your phone. Capture pictures and add images to your notes.\n\nSync notes across your devices to access them anytime, anywhere. Save ideas and check your list at home, in the office, or on the go across your devices. Search your notes quickly and effortlessly.\n\nTake notes, share ideas, organize and collaborate with Microsoft OneNote today.\n\nHomepage & Quick Capture Bar\n‚Ä¢ Find all notes from your connected accounts in one place to easily create, find, & act on your notes\n‚Ä¢ Now with Samsung Notes integration\n‚Ä¢ Capture text, voice, ink or images to your notepad with Quick Capture\n‚Ä¢ Capture notes in ink. Click the pen button & write down your thoughts\n\nScan Pictures & Extract Text\n‚Ä¢ Notes Scanner: Scan documents, pictures, or files to extract notes\n‚Ä¢ Capture images to extract text from documents, files, & more\n‚Ä¢ Apply different filters to change colors, add ink, crop images & more\n\nAudio Notes\n‚Ä¢ Take accurate voice notes with voice dictation\n‚Ä¢ Click the Mic button to begin recording, then click it again to end recording & save the file\n‚Ä¢ Dictate notes in 27 languages (note some languages are in preview) & use Auto-Punctutation to automatically format your notes\n\nCapture Content & Get Organized\n‚Ä¢ Write notes, draw & clip things from the web to add to your notebook\n‚Ä¢ Use OneNote‚Äôs flexible canvas to place content anywhere you want\n\nTake Notes & Achieve More\n‚Ä¢ Organize your notes using to-do lists, follow up items, marks for what‚Äôs important & custom labels\n‚Ä¢ Use OneNote as a notebook, journal or a notepad\n\nSave Ideas At The Speed of Light\n‚Ä¢ OneNote syncs your notes across all devices & lets multiple people work on the content together, at the same time\n‚Ä¢ Notepad badge hovers on screen & lets you quickly write your thoughts down any time\n‚Ä¢ Sticky notes are helpful for quick memos\n\nCollaborate & Share Notes\n‚Ä¢ Take meeting notes, brainstorm projects, & draw attention to important points\n‚Ä¢ Take notes & save ideas across your favorite devices, no matter what device your team likes to use\n‚Ä¢ Search your notes with a fast & powerful search function\n\nBetter Together With Microsoft Office\n‚Ä¢ OneNote is part of the Office family & works great with your favorite apps, such as Excel or Word, to help you do more\n\nWrite notes, save ideas & keep up with your to-do list with Microsoft OneNote.\n\nYou can find answers to frequently asked questions about OneNote for Android at http://aka.ms/OnenoteAndroidFAQ\n\nRequirements:\n‚Ä¢ Requires Android OS 5.0 or later.\n‚Ä¢ A free Microsoft account is required to use OneNote.\n‚Ä¢ OneNote opens existing notebooks created in Microsoft OneNote 2010 format or later.\n‚Ä¢ To sync your notes to OneDrive for Business, sign in with your organization‚Äôs Office 365 or SharePoint account.\n\nThis app is provided either by Microsoft or a third-party app publisher and is subject to a separate privacy statement and terms and conditions. Data provided through the use of this store and this app may be accessible to Microsoft or the third-party app publisher, as applicable, and transferred to, stored and processed in the United States or any other country where Microsoft or the app publisher and their affiliates or service providers maintain facilities.\n\nPlease refer to Microsoft‚Äôs End User License Agreement (EULA) for Terms of Service for OneNote on Android. By installing the app, you agree to these terms and conditions: https://support.office.com/legal?llcc=en-us&aid=OneNoteForAndroidLicenseTerms.htm. Microsoft‚Äôs privacy statement is available at https://privacy.microsoft.com/en-us/privacystatement",
